import React, { useEffect, useState } from "react";
import { Button } from "../components/ui/button";
import { Card, CardContent } from "../components/ui/card";

const SavedQuotes = () => {
  const [quotes, setQuotes] = useState([]);
  const [editingQuote, setEditingQuote] = useState(null);
  const [eventFilter, setEventFilter] = useState("");
  const [salesRepFilter, setSalesRepFilter] = useState("");
  const [startDate, setStartDate] = useState("");
  const [endDate, setEndDate] = useState("");

  useEffect(() => {
    const stored = localStorage.getItem("quotes");
    if (stored) {
      setQuotes(JSON.parse(stored));
    }
  }, []);

  const handleEdit = (quote) => {
    localStorage.setItem("activeQuote", JSON.stringify(quote));
    window.location.href = "/new-quote";
  };

  const handlePrint = (quote) => {
    const printContent = `Quote #${quote.id}\nCustomer: ${quote.customer.name}\nPhone: ${quote.customer.phone}\nEvent: ${quote.event}\nSales Rep: ${quote.salesRep}\nDate: ${new Date(quote.date).toLocaleDateString()}\nTotal: $${quote.total.toFixed(2)}`;
    const newWin = window.open("", "_blank");
    newWin.document.write(`<pre>${printContent}</pre>`);
    newWin.print();
    newWin.close();
  };

  const handleEmail = (quote) => {
    const subject = encodeURIComponent(`Quote #${quote.id}`);
    const body = encodeURIComponent(
      `Here is your quote:\n\nCustomer: ${quote.customer.name}\nPhone: ${quote.customer.phone}\nEvent: ${quote.event}\nSales Rep: ${quote.salesRep}\nDate: ${new Date(quote.date).toLocaleDateString()}\nTotal: $${quote.total.toFixed(2)}`
    );
    window.location.href = `mailto:?subject=${subject}&body=${body}`;
  };

  const uniqueEvents = [...new Set(quotes.map((q) => q.event).filter(Boolean))];
  const uniqueSalesReps = [...new Set(quotes.map((q) => q.salesRep).filter(Boolean))];

  const filteredQuotes = quotes.filter((quote) => {
    const matchEvent = eventFilter ? quote.event === eventFilter : true;
    const matchSalesRep = salesRepFilter ? quote.salesRep === salesRepFilter : true;
    const matchDate = (!startDate || new Date(quote.date) >= new Date(startDate)) &&
                      (!endDate || new Date(quote.date) <= new Date(endDate));
    return matchEvent && matchSalesRep && matchDate;
  });

  return (
    <div className="p-6 space-y-4">
      <h1 className="text-2xl font-bold mb-4">Saved Quotes</h1>

      <div className="grid grid-cols-1 sm:grid-cols-4 gap-4 mb-4">
        <select
          className="p-2 rounded border"
          value={eventFilter}
          onChange={(e) => setEventFilter(e.target.value)}
        >
          <option value="">All Events</option>
          {uniqueEvents.map((event, i) => (
            <option key={i} value={event}>{event}</option>
          ))}
        </select>

        <select
          className="p-2 rounded border"
          value={salesRepFilter}
          onChange={(e) => setSalesRepFilter(e.target.value)}
        >
          <option value="">All Sales Reps</option>
          {uniqueSalesReps.map((rep, i) => (
            <option key={i} value={rep}>{rep}</option>
          ))}
        </select>

        <input
          type="date"
          className="p-2 rounded border"
          value={startDate}
          onChange={(e) => setStartDate(e.target.value)}
        />
        <input
          type="date"
          className="p-2 rounded border"
          value={endDate}
          onChange={(e) => setEndDate(e.target.value)}
        />
      </div>

      {filteredQuotes.length === 0 ? (
        <p className="text-gray-600">No saved quotes found.</p>
      ) : (
        <div className="space-y-4">
          {filteredQuotes.map((quote) => (
            <Card key={quote.id} className="p-4">
              <CardContent className="space-y-2">
                <div className="flex justify-between">
                  <div>
                    <p className="font-semibold">{quote.customer.name}</p>
                    <p className="text-sm text-gray-500">{quote.customer.phone}</p>
                  </div>
                  <div className="text-right">
                    <p className="text-sm text-gray-500">
                      {new Date(quote.date).toLocaleDateString()}
                    </p>
                    <p className="font-semibold">${quote.total.toFixed(2)}</p>
                  </div>
                </div>
                <div className="text-sm text-gray-600">
                  Items: {quote.items.length} | Sales Rep: {quote.salesRep} | Event: {quote.event || "N/A"}
                </div>
                <div className="pt-2 space-x-2">
                  <Button onClick={() => handleEdit(quote)}>Edit</Button>
                  <Button onClick={() => handlePrint(quote)}>Print</Button>
                  <Button onClick={() => handleEmail(quote)}>Email</Button>
                </div>
              </CardContent>
            </Card>
          ))}
        </div>
      )}
    </div>
  );
};

export default SavedQuotes;
